sources.css/carousel.scss:
// ------------------------------- General  ----------------------
#carousel-section {
  position: absolute;
  top: 600px;
  height: 600px;
  width: 100%;
}

.carousel-item {
  // Each Slide
  position: relative;
  height: 600px;
  width: 100%;
  z-index: 100;
}

.carousel-inner img {
  width: 100%;
  height: 600px;
  opacity: 0.7;
  object-fit: cover;
}

#carousel-section p {
  font-family: serif, Times;
  font-size: $font-small;
}

.carousel-caption {
  // content container
  position: absolute;
  height: 500px;
  width: 80%;
  left: 10%;
  top: 30px;
  line-height: 1.4;
}

.carousel-indicators {
  position: absolute;
  bottom: 40px;
  z-index: 300;

  & li {
    height: 12px;
    width: 60px;
    border: 1px solid $dark-blue;
    border-radius: 20px;
  }
}

// ------------------------------ Public -----------------------

.about-flex-container {
  display: flex;
  flex-wrap: nowrap;
  position: absolute;
  top: 210px;
}

.about-flex-container p {
  color: black;
  padding: 15px 20px 15px 0;
  font-size: $font-small;
  text-align: left;
  line-height: 1.4;
}

.about-flex-container li {
  margin-right: 10px;
}

.carousel-item h3 {
  color: black;
  text-align: left;
  font-size: $font-middle;
  font-weight: 900;
}

.about-flex-container time {
  color: $light-blue;
  font-size: $font-middle;
  font-weight: 700;
}

// ------------------------- Page Tunner -------------------
.carousel-control-next,
.carousel-control-prev {
  position: absolute;
  top: 50%;
  height: 40px;
  width: 40px;
  margin: 20px;
  border-radius: 50px;
  border: 2px solid $basic-black;
  transform: translateY(-50%);
  z-index: 300;

  &:hover {
    transition: ease 0.5s;
  }
}

.carousel-control-prev img, .carousel-control-next img{
  height: 20px;
}
// ------------------------------ Social Media -----------------------
.carousel-social-media {
  position: absolute;
  left: 50%;
  top: 140px;
  height: 40px;
  width: 150px;
}

.carousel-social-media ul {
  display: flex;
  flex-wrap: nowrap;
  position: absolute;
  height: 40px;
  width: 200px;
  left: 0;
  top: 0;
  z-index: 300;
}

.carousel-social-media img {
  height: 30px;
  width: 30px;
  border-radius: 15%;
  margin-right: 15px;

  &:hover {
    cursor: pointer;
    width: 32px;
    height: 32px;
    transform: translateY(-5%);
  }
}

// ------------------------------ First Slide -----------------------

.carousel-first-container h2,
.carousel-secend-container h2,
.carousel-third-container h2 
 {
  position: absolute;
  top: 100px;
  left: 0px;
  color: black;
  font-size: $font-extra-large;
  font-weight: 600;

  &::after {
    @extend .underHeaderRedStrip;
  }
}

.carousel-first-container .about-flex-container p{
  flex: 1;
}

// ------------------------------- Second Slide ----------------------

.carousel-secend-container
.about-flex-container > li {
  width: 50%;
  text-align: left;
  font-size: $font-large;
}

.download-resume-carousel {
  @extend .download-resume;
  position: absolute;
  left: 80px;
  top: 80px;
  width: 300px;
  color: black;
  margin-left: 50%;
  border: 1px solid black;
}

// ------------------------------- Third Slide ----------------------
.carousel-third-container .about-flex-container li{
  flex: 1;
}

